import React from "react";
import "./css/style.css";

const Template1A = () => {
  return <>
    <div className="container">
      <div className="Template1A__container-left">
        <h3>Some sample heading here</h3>
        <p>Lorem ipsum dolor sit amet consectetur adipisicing elit. Vel tempore enim commodi quasi cupiditate quo.</p>
      </div>
      <div className="Template1A__container-right"></div>
    </div>
  </>;
};

const Templates = () => {
  return <div>Templates</div>;
};

export default Templates;
